import React from "react";

import ImageImport from "../../components/structure/ImageImport";

const Weingut = () => (

    <div className="weingut">

        <ImageImport 
        img= "/img/Weingut_Titelbild.jpeg"
        alt= "Weingut"
        className = "titleimage"
      /> 
            <h1>Weingut</h1>
            <p>
              Das ist das Weingut
        </p>





    </div>
)

export default Weingut;
